import React from "react";

import {useAuth} from "./AuthContext";
import {useRouter} from "next/router";


const PrivateRoute = ({children}) => {
  const {user} = useAuth()
 const router =  useRouter()
  if (!user) return router.push('login')
  return <>{children}</>
};

export default PrivateRoute;
